import React, { Component } from 'react'
import PropTypes from 'prop-types';
import withStyles from '@material-ui/core/styles/withStyles';
import {connect} from 'react-redux';

//MUI
import Button from '@material-ui/core/styles/withStyles';

export class Profile extends Component {
    render() {
        const {classes, user: {credentials: {username, createdAt, imageUrl, bio, website, location}, loading}} = this.props;
        return (
            <div>
                
            </div>
        )
    }
}

const mapStateToProps = (state) => ({
    user: state.user
});

Profile.propTypes = {
    user: PropTypes.object.isRequired,
    classes: PropTypes.object.isRequired
}

export default connect(mapStateToProps)(withStyles(Profile));
